import styled from 'styled-components/native';

export const Container = styled.View`
  padding: 10px 20px;
`;

export const AddressButton = styled.TouchableOpacity`
  display: flex;
  flex-direction: row;
`;

export const Location = styled.Text`
  color: #333;
  font-size: 16px;
  font-weight: bold;
`;
